import React, { useState, useEffect } from 'react';
import { supabase } from '../lib/supabaseClient';
import { useNavigate } from 'react-router-dom';
import '../styles/style.css';

const UserPreferences = () => {
  const [preferences, setPreferences] = useState({
    first_name: '',
    last_name: '',
    age: '',
    gender: '',
    height: '',
    weight: '',
    city: '',
    activity_level: 'low',
    anxiety_level: 'low',
    sleep_level: 'low',
    has_ecologica: false
  });

  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  // Map sleep quality levels to numeric values
  const sleepQualityMap = {
    'low': 2,
    'moderate': 5,
    'high': 9
  };

  const genderOptions = [
    'Select gender',
    'Male',
    'Female',
    'Non-binary',
    'Prefer not to say'
  ];

  const levelOptions = [
    'Low',
    'Moderate',
    'High'
  ];

  useEffect(() => {
    fetchPreferences();
  }, []);

  const fetchPreferences = async () => {
    try {
      const { data: { user }, error: userError } = await supabase.auth.getUser();

      if (userError) throw userError;

      if (!user) {
        navigate('/login');
        return;
      }

      const { data, error } = await supabase
        .from('user_preferences')
        .select('*')
        .eq('user_id', user.id)
        .single();

      if (error) throw error;

      if (data) {
        // Convert numeric sleep quality value back to string for UI
        const sleepLevel = Object.entries(sleepQualityMap).find(([key, value]) => value === data.sleep_level)?.[0] || 'low';
        setPreferences({
          ...data,
          sleep_level: sleepLevel
        });
      }
    } catch (error) {
      console.error('Error fetching preferences:', error.message);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSave = async (e) => {
    e.preventDefault();

    try {
      const { data: { user }, error: userError } = await supabase.auth.getUser();

      if (userError) throw userError;

      if (!user) {
        alert('Please log in to save preferences');
        navigate('/login');
        return;
      }

      // Convert sleep_level to numeric value before saving
      const dataToSave = {
        ...preferences,
        user_id: user.id,
        sleep_level: sleepQualityMap[preferences.sleep_level],
        updated_at: new Date().toISOString()
      };

      const { error } = await supabase
        .from('user_preferences')
        .upsert(dataToSave, {
          onConflict: 'user_id'
        });

      if (error) throw error;

      alert('Profile updated successfully!');
      navigate('/dashboard');
    } catch (error) {
      console.error('Error saving preferences:', error.message);
      alert('Error updating profile: ' + error.message);
    }
  };

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="preferences-container">
      <div className="preferences-content">
        <h1 className="preferences-title">Profile</h1>

        <form onSubmit={handleSave} className="preferences-form">
          <div className="form-row">
            <div className="form-group">
              <label>First Name</label>
              <input
                type="text"
                value={preferences.first_name}
                onChange={(e) => setPreferences({ ...preferences, first_name: e.target.value })}
                className="form-input"
                placeholder="Enter first name"
              />
            </div>

            <div className="form-group">
              <label>Last Name</label>
              <input
                type="text"
                value={preferences.last_name}
                onChange={(e) => setPreferences({ ...preferences, last_name: e.target.value })}
                className="form-input"
                placeholder="Enter last name"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Age</label>
              <input
                type="number"
                value={preferences.age}
                onChange={(e) => setPreferences({ ...preferences, age: e.target.value })}
                className="form-input"
                placeholder="Enter age"
                min="0"
                max="120"
              />
            </div>

            <div className="form-group">
              <label>Gender</label>
              <select
                value={preferences.gender}
                onChange={(e) => setPreferences({ ...preferences, gender: e.target.value })}
                className="form-select"
              >
                {genderOptions.map(option => (
                  <option key={option} value={option === 'Select gender' ? '' : option}>
                    {option}
                  </option>
                ))}
              </select>
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Height (cm)</label>
              <input
                type="number"
                value={preferences.height}
                onChange={(e) => setPreferences({ ...preferences, height: e.target.value })}
                className="form-input"
                placeholder="Enter height"
                min="0"
                max="300"
              />
            </div>

            <div className="form-group">
              <label>Weight (kg)</label>
              <input
                type="number"
                value={preferences.weight}
                onChange={(e) => setPreferences({ ...preferences, weight: e.target.value })}
                className="form-input"
                placeholder="Enter weight"
                min="0"
                max="500"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Activity Level</label>
              <select
                value={preferences.activity_level}
                onChange={(e) => setPreferences({ ...preferences, activity_level: e.target.value })}
                className="form-select"
              >
                {levelOptions.map(option => (
                  <option key={option} value={option.toLowerCase()}>
                    {option}
                  </option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>Anxiety Level</label>
              <select
                value={preferences.anxiety_level}
                onChange={(e) => setPreferences({ ...preferences, anxiety_level: e.target.value })}
                className="form-select"
              >
                {levelOptions.map(option => (
                  <option key={option} value={option.toLowerCase()}>
                    {option}
                  </option>
                ))}
              </select>
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Sleep Quality</label>
              <select
                value={preferences.sleep_level}
                onChange={(e) => setPreferences({ ...preferences, sleep_level: e.target.value })}
                className="form-select"
              >
                {levelOptions.map(option => (
                  <option key={option} value={option.toLowerCase()}>
                    {option}
                  </option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>City</label>
              <input
                type="text"
                value={preferences.city}
                onChange={(e) => setPreferences({ ...preferences, city: e.target.value })}
                className="form-input"
                placeholder="Enter city"
              />
            </div>
          </div>

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.has_ecologica}
                onChange={(e) => setPreferences({ ...preferences, has_ecologica: e.target.checked })}
              />
              I have an Ecologica air purifier
            </label>
          </div>

          <button type="submit" className="save-button">
            Save Changes
          </button>
        </form>
      </div>
    </div>
  );
};

export default UserPreferences;
